import React, { Component } from 'react';
import PropTypes from 'prop-types';
import ChatBot from 'react-simple-chatbot';

class Review extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: '',
      city: '',
      number: '',
      sName: '',
      sSlogane: '',
    };
  }

  componentWillMount() {
    const { steps } = this.props;
    const { name, city, number, sName, sSlogane } = steps;

    this.setState({ name, city, number, sName, sSlogane });
  }

  render() {
    const { name, city, number, sName, sSlogane } = this.state;
    return (
      <div style={{ width: '100%' }}>
        <h3>Summary</h3>
        <table>
          <tbody>
            <tr>
              <td>Name</td>
              <td>{name.value}</td>
            </tr>
            <tr>
              <td>city</td>
              <td>{city.value}</td>
            </tr>
            <tr>
              <td>number</td>
              <td>{number.value}</td>
            </tr>
            <tr>
              <td>site name</td>
              <td>{sName.value}</td>
            </tr>
            <tr>
              <td>site slogane</td>
              <td>{sSlogane.value}</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

Review.propTypes = {
  steps: PropTypes.object,
};

Review.defaultProps = {
  steps: undefined,
};

class HasChatBoot extends Component {
  render() {
    return (
      <ChatBot
        steps={[
          {
            id: '1',
            message: 'What is your name?',
            trigger: 'name',
          },
          {
            id: 'name',
            user: true,
            trigger: '3',
          },
          {
            id: '3',
            message: 'Hi {previousValue}! Can i help you?',
            trigger: 'yes',
          },
          {
            id: 'yes',
            user: true,
            trigger: 'question',
          },          
          {
            id: 'question',
            user: true,
            trigger: '5',
            validator: (value) => {
              if (value == "what city?") {
                return 'Alexandria';
              } else if (value == "what number?" ) {
                return '01090761007';
              } else if (value == "what site name?") {
                return `Has health`;
              } else if (value == "what site slogan?") {
                return `where care found`;
              }

              return true;
            },
          },
          {
            id: '6',
            message: 'Great! Check out your summary',
            trigger: 'review',
          },
          {
            id: 'review',
            component: <Review />,
            asMessage: true,
            trigger: 'update',
          },
          {
            id: 'update',
            message: 'Would you like to update some field?',
            trigger: 'update-question',
          },
          {
            id: 'update-question',
            options: [
              { value: 'yes', label: 'Yes', trigger: 'update-yes' },
              { value: 'no', label: 'No', trigger: 'end-message' },
            ],
          },
          {
            id: 'update-yes',
            message: 'What field would you like to update?',
            trigger: 'update-fields',
          },
          {
            id: 'update-fields',
            options: [  //name, city, number, sName, sSlogane
              { value: 'name', label: 'Name', trigger: 'update-name' },
              { value: 'city', label: 'City', trigger: 'update-city' },
              { value: 'number', label: 'Number', trigger: 'update-number' },
              { value: 'sName', label: 'Site Name', trigger: 'update-sName' },
              { value: 'sSlogane', label: 'Site Slogane', trigger: 'update-sSlogane' },
            ],
          },
          {
            id: 'update-name',
            update: 'name',
            trigger: '6',
          },
          {
            id: 'update-city',
            update: 'city',
            trigger: '6',
          },
          {
            id: 'update-number',
            update: 'number',
            trigger: '6',
          },
          {
            id: 'update-sName',
            update: 'sName',
            trigger: '6',
          },
          {
            id: 'update-sSlogane',
            update: 'sSlogane',
            trigger: '6',
          },
          {
            id: 'end-message',
            message: 'Thanks! Your data was submitted successfully!',
            end: true,
          },
        ]}
      />
    );
  }
}

export default HasChatBoot;
